    }

    createBody () {
        pass
    }

    send () {
        console.log(this.event)
        console.log(this.id)
        const headers = {
            'Content-Type': 'application/json'
        }
        return fetch(this.url, {
            method: 'POST',
            body: JSON.stringify(this.body),
            headers: headers
        }).then(response => {
            return response.json()
        })
    }
}

export default OnStatistic;
